I'm trying to create a rust app that can read the contents of the clipboard aloud using the elevenlabs.io api. I've been able to create a simple rust app that can read the contents of the clipboard aloud using the `tts` crate, but I'm having trouble integrating the elevenlabs.io api into the app.

Here's what I have so far:

```
use tts::Tts;
use clipboard::ClipboardProvider;

fn main() {
    let text = ClipboardProvider::new().sync().unwrap();
    let tts = Tts::new().unwrap();
    tts.say(text).unwrap();
}
```

I'm not sure how to integrate the elevenlabs.io api into this app. Can someone help me with that?

Here's the relevant part of the elevenlabs.io api documentation:

```
